import { Flex, IconButton } from "@chakra-ui/react"
import {HamburgerIcon} from "@chakra-ui/icons"

export default function NavBar(){
  return(
    <Flex  w="100%" h="2rem" >
      <IconButton
        colorScheme='teal'
        aria-label='Call Segun'
        size='lg'
        icon={<HamburgerIcon />}
      />
      
    </Flex>
  )
}
